          <Link to="/works">Trabalhos</Link>
          <Link to="/contact">Contato</Link>
          <Link to="/about">Sobre</Link>
        </nav>
        <div>
          <h1>Entre em contato!</h1>
          <section>
            <a href="https://www.linkedin.com/in/tarcÃ­sio-menezes/" target="blank">Linkedin</a>
